import {useEffect, useState} from "react";

export default function Roles() {
    const [currentHightlight, setCurrentHighlight] = useState(0)
    useEffect(() => {
        const interval = setInterval(() => {
            setCurrentHighlight(currentHightlight => currentHightlight === roles.length - 1 ? 0 : currentHightlight + 1)
        },1000)
        return () => clearInterval(interval)
    },[])
    return <div className="relative bg-gray-50 pt-16 pb-20 px-4 sm:px-6 lg:pt-24 lg:pb-28 lg:px-8">
        <div className="absolute inset-0">
            <div className="bg-white h-1/3 sm:h-2/3"/>
        </div>
        <div className="relative max-w-7xl mx-auto">
            <div className="mt-12 max-w-lg mx-auto grid gap-5 md:grid-cols-2 lg:grid-cols-4 md:max-w-none">
                {roles.map((role, i) => {
console.log(role)
console.log(i)
                    return <div id={role.title} className={i===currentHightlight?"animate-grow":""}><RoleCard {...role} /></div>
                })}

            </div>
        </div>
    </div>

}


